// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import MainPage from './component/MainPage';
import DetailPage from './component/DetailPage';
import LoginPage from './component/LoginPage';
import SignupPage from './component/SignupPage';
import MyPage from './component/MyPage';
import './App.css';
import SearchPage from './component/SearchPage';  // SearchPageë¥¼ import


const App = () => {
  return (
    <Router>
      <div>
        <header>
          <div className="center">
          <h1><Link to="/">TRY</Link></h1>
          <div className="search-box">
            <input type="text" placeholder="Search" />
            <Link to="/search"><button type="button">search</button></Link>
          </div>
          <nav>
            <Link to="/login">ë¡ê·¸ì¸</Link>
            <Link to="/signup">íìê°ì</Link>
            <Link to="/mypage">ë§ì´íì´ì§</Link>
          </nav>
          </div>
        </header>
        <nav>
          <ul>
            <li><Link to="/category/politics">Politics</Link></li>
            <li><Link to="/category/economy">Economy</Link></li>
            <li><Link to="/category/society">Society</Link></li>
            <li><Link to="/category/it">IT</Link></li>
            <li><Link to="/category/world">World</Link></li>
            <li><Link to="/category/culture">Culture</Link></li>
          </ul>
        </nav>
        <div className="container">
          <Routes>
            <Route path="/" element={<MainPage />} />
            <Route path="/search" element={<SearchPage />} /> {/* SearchPage ì¶ê° */}
            <Route path="/detail/:id" element={<DetailPage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/signup" element={<SignupPage />} />
            <Route path="/mypage" element={<MyPage />} />
          </Routes>
        </div>
        <div className="footer">
          Â© 2023 News App. All rights reserved.
        </div>
      </div>
    </Router>
  );
};

export default App;
